import React from 'react';
import Users from './Users'
import users from './users.json'


function App(){
users.users.map
  const UserList = users.users.map(SingleData => <Users key={SingleData.userId} firstname={SingleData.firstName} lastName={SingleData.lastName} phonenumer={SingleData.phoneNumber} email={SingleData.emailAddress} />)  
  return(
    <div>
      <Users />
    </div>
  )
}

export default App;
